import React, { useContext, useState } from 'react'
import './cart.css'
import { StoreContext } from '../../context/StoreContext.js';
import { food_list } from '../../component/assets/assets/assets.js'
const Cart = () => {
  const {cartItem,removeToCart}=useContext(StoreContext);
  return (
    <div className='cart'>
      <div className="cart-items">
        <div className="cart-items-title">
          <p>Items</p>
          <p>Title</p>
          <p>Price</p>
          <p>Quantity</p>
          <p>Total</p>
          <p>Remove</p>
        </div>
        <br />
        <hr />
        {
            food_list.map((item,ind)=>{
              <p>{cartItem[ind]}</p>
            })
        }
      </div>
    </div>
  )
}

export default Cart
